% Regola: telefono_cluster(Id, Cluster) significa " Id  l'identificatore di un telefono con cluster di appartenenza di Cluster"
telefono_cluster(Id, Cluster) :- telefono(Id, _, _, _, _, _, _, _, _, _, _, _, Cluster).

% Regola: telefono_con_ram(Id, Ram) significa "Id  l'identificatore di un telefono con Ram quantit di RAM"
telefono_con_ram(Id, Ram) :- telefono(Id, _, _, _, _, _, _, _, _, _, _, Ram, _).

% Regola: telefono_con_battery_power(Id, BatteryPower) significa "Id  l'identificatore di un telefono con BatteryPower potenza della batteria"
telefono_con_battery_power(Id, BatteryPower) :- telefono(Id, BatteryPower, _, _, _, _, _, _, _, _, _, _, _).

% Regola: telefono_ad_alte_prestazioni(Id) significa "Id  l'identificatore di un telefono con almeno 0.8 di RAM e almeno 0.7 di potenza della batteria"
telefono_ad_alte_prestazioni(Id) :- telefono(Id, BatteryPower, _, _, _, _, _, _, _, _, _, Ram, _), Ram >= 0.8, BatteryPower >= 0.7.
